--TASK_DETAIIL TABLE CREATION
DECLARE n NUMBER;
BEGIN
  SELECT count(*) INTO n FROM user_tables  WHERE TABLE_NAME = 'TASK_DETAIL';
  IF n = 0 
  THEN
    EXECUTE IMMEDIATE 'CREATE TABLE TASK_DETAIL( 
        TASK_ID NUMBER GENERATED BY DEFAULT AS IDENTITY,
        DROP_ID NUMBER NOT NULL,
        ORDER_ID NUMBER NOT NULL,
        ITEM_ID NUMBER NOT NULL,
        TASK_DESC VARCHAR(32) NOT NULL,
        TASK_DATE DATE,
        STATUS VARCHAR(30) NOT NULL,
        QTY NUMBER,
        PRIMARY KEY(TASK_ID),
        CONSTRAINT FK_TASK_DETAIL
            FOREIGN KEY (DROP_ID)
            REFERENCES DROPID(DROP_ID),
            FOREIGN KEY (ORDER_ID)
            REFERENCES ORDERS(ORDER_ID),
            FOREIGN KEY (ITEM_ID)
            REFERENCES ITEM(ITEM_ID)
        )';
 END IF;
END;
